descripcion:
* ATX
* 1. Material: placa de acero SPCC de 0,8 mm de alta calidad, la superficie está horneada con pintura de grano de arena negra;
* 2. Número de tarjetas gráficas compatibles: Según la placa base, la longitud y el ancho de las tarjetas gráficas no están limitados;
* 3. Placa base de soporte: placas base de soporte dentro de 305 * 245 mm: ATX, Micro ATX, ITX;
* 4. Fuente de alimentación de soporte: fuente de alimentación ATX estándar, tamaño de referencia 150 mm * 86 mm * (140-250) mm;
* 5. Admite 1 SSD, 1 HDD;
* Política postventa:
* Caso 1:
* 1. La información logística del paquete no se ha actualizado durante 14 días.
* 2. La mercancía es perdida por la empresa de logística.
* Si se encuentra con la situación anterior, envíenos un correo electrónico directamente y volveremos a emitir o reembolsaremos por usted.
* Caso 2:
* 1. La mercancía está dañada o doblada.
* Si se encuentra con la situación anterior, tome fotos del paquete y el producto y muéstrenoslas directamente por correo electrónico, volveremos a emitir o reembolsaremos por usted.
